const Navigation = () => {
  return (
    <div>
      <img src="https://res.cloudinary.com/robcg1102/image/upload/v1604355701/maq_img/logo_nqvtbv.png" alt=""/>
      <TextField id="standard-basic" label="Buscar producto" />
    </div>
  );
};
export default Navigation;
